  return (
    <div>
      <StarRating color="blue" maxRating={10} />
      <p> This movies was rated x starts</p>
    </div>
  );
}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    {/* <App /> */}
    <StarRating
      maxRating={10}
      message={[
        'Terrible',
        'Bad',
        'Not too Bad',
        'Okay',
